// Section1.js
import React, { useEffect, useState } from 'react';
import styled from 'styled-components';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHeart } from '@fortawesome/free-solid-svg-icons';
import axios from 'axios';
import { faChevronLeft, faChevronRight } from '@fortawesome/free-solid-svg-icons';
import {  faUser as regularUser, faHeart as regularHeart } from '@fortawesome/free-regular-svg-icons'; 
import items from '../data.js'; // 임의 데이터 파일 import
import { useNavigate } from 'react-router-dom'; // useNavigate 훅 import

//각 섹션의 데이터를 상태로 관리합니다: useState를 사용하여 데이터를 저장하고, 
//useEffect를 통해 컴포넌트가 마운트될 때 데이터를 Fetch합니다.

function Section1({ onProjectClick }) {
  const [popularProjects, setPopularProjects] = useState([]);
  //    [ 현재 상태값, 상태 업데이트 함수]
  const navigate = useNavigate(); // useNavigate 훅을 사용하여 navigate 함수 생성



  // const fetchPopularProjects = async () => {
  //   try {
  //     const response = await axios.get('/api/projects/popular'); // 인기 프로젝트 데이터 요청
  //     setPopularProjects(response.data);
  //   } catch (error) {
  //     console.error('Error fetching popular projects:', error);
  //   }
  // };

  const fetchPopularProjects = () => {
    //instead api use data.js (for practice)
    setPopularProjects(items)

  }

  // 슬라이드의 ID를 설정
  const sliderId = 'itemSlider';

  //단순화한 코드
  // const fetchPopularProjects = async () => {
  //   const response = await axios.get('/api/projects/popular');
  //   setPopularProjects(response.data);
  // };
  useEffect(() => {
    fetchPopularProjects();
  }, []);


  const handleProjectClick = (project) => {
    // 클릭된 프로젝트의 ID를 사용하여 상세 페이지로 이동
    // navigate(`/projects/${project.id}`); // 경로는 필요에 따라 수정하세요
    navigate('/ApplyPage');
  };


  return (
    <SectionWrapper>
      <SectionTitle>인기 프로젝트</SectionTitle>
      <ProjectList>
        {popularProjects.slice(0, 3).map((project, index) => (
          <ProjectCard key={index} onClick={() => handleProjectClick(project)}>
            <ProjectOwner> <FontAwesomeIcon icon={regularUser} style={{ fontSize: '20px', lineHeight: '1.2' }} />{project.creatorid}</ProjectOwner>
            <ProjectLikes>
              <FontAwesomeIcon icon={regularHeartt} style={{ color: '#C4C4C4'}} />
              {project.likescount}
            </ProjectLikes>
            <ProjectTitle>{project.title}</ProjectTitle>
            <ProjectInfo>
              <Tags>
                {project.tags.map((tag, tagIndex) => (
                  <Tag key={tagIndex}>{tag}</Tag>
                ))}
              </Tags>
              <Details>
                모집인원: {project.recruitmentnum}명 | 마감일: {new Date(project.deadline).toLocaleDateString()}
              </Details>
            </ProjectInfo>
          </ProjectCard>
        ))}
      </ProjectList>
    </SectionWrapper>
  );
}

// 스타일 컴포넌트 

// 스타일 컴포넌트
const SectionWrapper = styled.div`
  width: calc(100% / 2 + 100px);
  border: 2px solid #A0DAFB;
  border-radius: 30px 30px 1px 30px;
  box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);
  gap: 20px;
  background-color: rgba(160, 218, 251, 0.5);
`;

const SectionTitle = styled.h2`
  font-size: 24px;
  margin-bottom: 20px;
`;

const ProjectList = styled.div`
  display: flex;
  justify-content: center;
  flex-wrap: wrap;
  gap: 20px;
`;

const ProjectCard = styled.div`
  position: relative;
  border: 2px solid #A0DAFB;
  border-radius: 30px 30px 1px 30px;
  padding: 15px;
  margin-bottom: 20px;
  width: calc(100% / 4);
  box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);
  background-color: white;
  cursor: pointer;

  &:hover {
    background-color: #A0DAFB;
  }
`;

const ProjectOwner = styled.div`
  font-weight: bold;
  position: absolute;
`;

const ProjectLikes = styled.div`
  border: 1px solid #ddd;
  border-radius: 15px;
  font-weight: bold;
  width: calc(100% / 4);
  right: 10%;
  position: absolute;
`;

const ProjectTitle = styled.div`
  font-size: 20px;
  margin: 30px 0;
  font-weight: bold;
`;

const ProjectInfo = styled.div`
  font-size: 14px;
  color: #777;
`;

const Tags = styled.div`
  display: flex;
  margin-bottom: 5px;
  align-items: space-between;
`;

const Tag = styled.div`
  margin-bottom: 5px;
  margin-left: 5px;
  border: 1px solid #ddd;
  border-radius: 15px;
  padding: 5px 10px;

  box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);
  background-color: white;
  border-color: rgba(160, 218, 251);
  color: #0A8ED9;
`;

const Details = styled.div``;


export default Section1;
